	local data = _G.Plater.DecompressData(profileString, 'print')

	-- Profile import
	if _G.PlaterDB.profiles[name] then
		tinsert(_G.PlaterDB.profileKeys, E.mynameRealm)
		_G.PlaterDB.profileKeys[E.mynameRealm] = name
	else
		_G.PlaterDB.profiles[name] = data
		_G.PlaterDB.profileKeys[E.mynameRealm] = name
	end

	-- Adjustments for 1080p
	if scaled then
		_G.PlaterDB.profiles[name].blizzard_nameplate_font_size = 9
		_G.PlaterDB.profiles[name].blizzard_nameplate_large_font_size = 11
		_G.PlaterDB.profiles[name].extra_icon_anchor.x = -17
	end

	-- We don't want Plater to use their random scaling math on our profiles
	-- People want the profile exactly like on the screenshot, this fixes it
	_G.PlaterDB.profiles[name].use_ui_parent = true
	_G.PlaterDB.profiles[name].ui_parent_scale_tune = scaled and 0.8 or 1
	_G.PlaterDB.profiles[name].ui_parent_target_strata = 'BACKGROUND'

	if installer then
		_G.LuckyoneInstallStepComplete.message = L["Plater profile has been set."]
		_G.LuckyoneInstallStepComplete:Show()
	end

	Private:Print(L["Plater profile has been set."])
end
